import React from 'react';

const StageComp = () => {
    return (
        <div
            className="w-[472px] px-6 py-4 bg-white rounded-[14px] flex-col justify-center items-center gap-3 inline-flex">
            <div className="w-56 h-8 text-black text-xl font-medium font-['Roboto'] leading-normal tracking-tight">Открытие г. Волгоград
            </div>
            <div className="w-[424px] h-[235px] bg-gradient-to-b from-black to-black rounded-[20px] border border-black"/>
            <div className="w-[223px] text-neutral-800 text-base font-normal font-['Roboto'] leading-normal tracking-tight">Количество участников - 140
            </div>
            <div className="px-2.5 py-[13px] bg-white rounded-[30px] border border-neutral-400 justify-center items-center gap-2.5 inline-flex">
                <div className="text-center text-black text-base font-normal font-['Roboto']">Смотреть больше</div>
            </div>
        </div>
    );
};

export default StageComp;
